import './App.css';
import About from './pages/about'
import Skills from './pages/skills'
import Education from './pages/education'
import Projects from './pages/projects'
import Contact from './pages/contact'

function App() {

  return (
    <div className="App">
      <About />
      <Skills />
      <Education />
      <Projects />
      <Contact />
    </div>
  );
}

export default App;
